import React, { useEffect } from 'react';
import axios from 'axios';
import './App.css';

export default function Detail() {
	const API_KEY = 'aa612f293de8cfae23f3d56312b5f998';
	useEffect(() => {}, []);

	const fetchMovie = async () => {
		const movie = await axios.get('https://api.themoviedb.org/3/keyword/', {
			params: {
				api_key: API_KEY,
				keybord_id: '775996',
			},
		});
	};

	return <h1 className='detail'>this is details page</h1>;
}
